import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
import "./App.css";
import Banner from "./components/Banner";
import About from "./components/About";
import "./index.css";
function App() {
  return (
    <div className="App">
      <Banner />
      <About />
    </div>
  );
}

export default App;
